import React from "react";
import { useState } from "react";

import ToggleButton_img from '../../1_image_or_icon/Door_icon.jpg'

export const OnOff_Toggler = () => {

    const [ TabNevBar_Status, updateOnnOff] = useState()

    return <React.Fragment>

        <img
        id="ToggleButton"
        src={ToggleButton_img}></img>

    </React.Fragment>

}

export default OnOff_Toggler;
